import React from "react";
import { Link } from "react-router-dom";
import "./Navigation.css";

function Navigation() {
    return (
        <div className="Nav">
            <Link className="L1" to="/">Home</Link>
            <Link className="L2" to="/about">About</Link>
        </div>
    );
}

export default Navigation;
